import React, { useState } from 'react';
import friendService from '../../services/friendService';

const FriendRequestSender = ({ userId }) => {
    const [receiverId, setReceiverId] = useState('');

    const handleSendRequest = () => {
        friendService.sendFriendRequest(userId, receiverId)
            .then(response => {
                console.log('Friend request sent:', response.data);
            })
            .catch(error => {
                console.error('Error sending friend request:', error);
            });
    };

    return (
        <div>
            <input 
                type="text" 
                value={receiverId} 
                onChange={(e) => setReceiverId(e.target.value)} 
                placeholder="Enter User ID to send request" 
            />
            <button onClick={handleSendRequest}>Send Friend Request</button>
        </div>
    );
};

export default FriendRequestSender;
